import { useState } from "react";
import { useSelector } from "react-redux";

import { ComponentMembershipTier } from "@components";
import { selectMerchant } from "@redux";
import { IMembershipTier } from "@interfaces";

export const ModuleMemberShipTier = () => {
    //page states
    const [membershipTier, setMemvershipTier] = useState<IMembershipTier | undefined>();
    const { membershipTiers } = useSelector(selectMerchant);

    const handleClickNext = (id: string) => {
        console.log(id);
        const index = membershipTiers?.findIndex((membershipTier) => membershipTier._id === id);
    };

    return <>{!membershipTier && <ComponentMembershipTier handleClickNext={handleClickNext} />}</>;
};
